import React from 'react';
import Nav from '../../Nav';
import {contactPage} from '../../../constants/constants';

function postCabin() {
    const options = {
      method: 'POST',
      headers : {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(contactPage)

    }
    fetch('/cabins', options)
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
  };

export default function Login (props) {
    return(
        <>
            <Nav />
            <p>Hello from PostCabin</p>
            <button onclick={postCabin()}>Post a cabin</button>
        </>
    )
}
